import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class App extends React.Component {



  render() {
    return (


     <browerserRouter>

          <Navigation/>

          <Route exaxt to="/">
            <Home>
            </Home>
          </Route>

          <Route exaxt to="/signin">
            <SignIn/>
          </Route>

     </browerserRouter>



     );
  }

}

export default App;
